lude>code_template/**/*.*</include>\n					<include>conf/**/*.*</include>\n				</includes>\n			</resource>\n		</resources>\n		<outputDirectory>src/main/webapp/WEB-INF/classes</outputDirectory>\n		<testOutputDirectory>src/main/webapp/WEB-INF/classes</testOutputDirectory>\n		<plugins>\n			<plugin>\n				<groupId>org.apache.maven.plugins</groupId>\n				<artifactId>maven-compiler-plugin</artifactId>\n				<version>3.1</version>\n				<configuration>\n					<source>1.7</source>\n					<target>1.7</target>\n					<encoding>UTF-8</encoding>\n				</configuration>\n			</plugin>\n			<plugin>\n				<artifactId>maven-war-plugin</artifactId>\n				<version>2.6</version>\n				<configuration>\n					<packagingExcludes>WEB-INF/ctrl/,WEB-INF/directive/,WEB-INF/filter/,WEB-INF/gulp/</packagingExcludes>\n				</configuration>\n			</plugin>\n		</plugins>\n  	</build>\n</project>\n'),(8,8,'package com.ac.web.generate.controller;\n\nimport java.text.SimpleDateFormat;\nimport org.springframework.web.servlet.view.freemarker.FreeMarkerConfigurer;\n\nimport com.ac.web.generate.services.redis.JedisUtilService;\nimport com.google.common.collect.Maps;\n\n@Controller\n@RequestMapping(value=\"/test/\")\npublic class TestCtrl {\n\n	@Autowired\n	private FreeMarkerConfigurer freemarkerConfig;\n	\n	@Autowired\n	private JedisUtilService jedisUtilService;\n	\n//	@Resource(name = \"stringValueOperations\")\n//	private ValueOperations<String, String> redisStringOp;\n	\n//	@RequestMapping(value=\"testRedis\")\n//	public @ResponseBody String testRedis() {\n//		redisStringOp.set(\"test\", \"123\");\n//		String test = redisStringOp.get(\"test\");\n//		return test;\n//	}\n	\n	@RequestMapping(value=\"test\")\n	public @ResponseBody String test() {\n		return \"aa\";\n	}\n	\n}\n'),(9,9,'ssh -p 22022 root@10.10.72.197 2016adtest197\nssh -p 22022 root@10.10.72.209 GBttdJlr2T4j\nssh -p 22022 root@10.10.72.199 2016adtest199\nssh -p 22022 root@10.10.221.93 2016adtest93\nssh -p 22022 root@10.10.69.173 2016adtest173\nssh -p 22022 root@10.10.69.174 2016adtest174\nssh -p 22022 root@10.10.69.177 2016adtest177\n\nssh -p 22022 root@10.10.221.142 ubTNm5KE60EVkRxq\n\n-------109：线上从库等环境中间机器 --------\nssh -p 22022 root@10.103.51.109 GAauOCK5ZatL\n\n-------166：数据库、redis服务器------\nssh -p 22022 root@10.10.73.166  yYYbbfIbPDYL\n\n-------167：dsp、crm测试机------\nssh -p 22022 root@10.10.73.167  NAgfcAlmwHDe\n\n\n-------168：yes、rev测试机------\nssh -p 22022 root@10.10.73.168  kXHlwgjlSTQf\n\n-------105：ADM测试机------\nssh -p 22022 root@10.10.221.105 NLiLWOvMp0Yz\n\nyouku\nsdSD*ss2D_ctsd\n\n13939033193 weixiao911\n\n\nRev@youku>>04\nCrm12@youku>>\nYouku$>>08Mda\nYes07@youku>>\n\n//夏楠的机器\n10.10.23.90 root xiaotong\n\n\nsudo killall -9 networkd\n'),(10,10,'<%@page import=\"java.util.Date\"%>\n<%@ page language=\"java\" contentType=\"text/html;charset=utf-8\"%>\n\n<%@ taglib uri=\"http://java.sun.com/jsp/jstl/core\" prefix=\"c\"%> \n\n<c:set var=\"ctx\" value=\"${pageContext.request.contextPath}\"></c:set>\n<c:set var=\"sysVersion\" value=\"${applicationScope.SysVersion}\"></c:set>\n\n<!DOCTYPE html>\n<html lang=\"zh-CN\" ng-app=\"myApp\">\n	\n'),(11,11,'查看连接数\r\nshow processlist;\r\nshow status like \'%onn%\';\r\n\r\n\r\nmysqldump -h 10.103.7.169 -uad-select -p2DFeCwxfE4rN --lock-tables=false ad agent crm_action   > crm_mini.sql\r\n\r\ncrm_order_advertising_fee_income\r\n\r\n\r\n安装\r\nshell> groupadd mysql\r\nshell> useradd -r -g mysql mysql\r\nshell> cd /usr/local\r\nshell> tar zxvf /path/to/mysql-VERSION-OS.tar.gz\r\nshell> ln -s full-path-to-mysql-VERSION-OS mysql\r\nshell> cd mysql\r\nshell> chown -R mysql .\r\nshell> chgrp -R mysql .\r\n\r\n---mysql----5.6\r\nshell> bin/mysql_install_db --user=mysql\r\n\r\n---mysql----5.7\r\nshell> bin/mysqld --initialize --user=mysql --basedir=/opt/mysql --datadir=/opt/mysql/data\r\n\r\n启动\r\nmysqld_safe  --defaults-file=/etc/my.cnf --user=root &\r\n关闭\r\nmysqladmin shutdown\r\n\r\n\r\nshell> chown -R root .\r\nshell> chown -R mysql data\r\nshell> bin/mysqld_safe --user=mysql &\r\n# Next command is optional\r\nshell> cp support-files/mysql.server /etc/init.d/mysql.server\r\n\r\n --ignore-table=db_name.tbl_name\r\n\r\n\r\n连接：mysql -h 127.0.0.1 -u 用户名 -p 数据库\r\nmysql -h 127.0.0.1 -u root -p ad_test(注意：后面没有\";\")\r\n\r\nmysql -uroot -p123456 ad --default-character-set=utf8 --show-progress-size=1500 < db.file\r\n\r\n备份\r\nmysqldump -u root -p 4sms --password=123 --triggers > 4sms.sql\r\n\r\nmysqldump -u youku -h 10.103.51.121 -p survey --password=sdSD*ss2D_ctsd > /opt/backup/survey.sql.20120416\r\n\r\n\r\nmysqldump --no-defaults\r\n\r\n[your mysqldump command] | sed \"s/\\\\\\\'/\'\'/g\" > dumpfile.sql\r\nmysqldump test | sed -e \"s/\\\\\\\'/\'\'/g\" > test-dump.sql\r\n\r\n导出表：mysqldump\r\nmysqldump --no-defaults -u root -p ad crm_stat_menu > crm_stat_menu.sql\r\n\r\n\r\n--no-defaults 在出现unknown option的情况下加,如 unknown option \'--no-beep\'\r\n\r\n导出某个结果集\r\nselect name from vp_position into outfile \'1.txt\';\r\nselect name from vp_position into outfile \'1.txt\' fields terminated by \'\\t\' LINES TERMINATED BY \"\\r\\n\";\r\n//mysql data所在的目录，不能指定其它路径，\r\n查看mysql data路径方法：\r\nshow variables;\r\ndatadir\r\nshow variables where variable_name like \'%datadir%\';\r\n\r\n\r\n导入表：source或者load data\r\nsource C:\\Documents and Settings\\User\\桌面\\statSql\\crm_customer_dictionary.sql\r\nload data infile \'a.txt\' into table table_a;\r\nload data infile \'F:/import/33.txt\' into table crm_stat_achievement_income_import fields terminated by \'\\t\' LINES TERMINATED BY \"\\r\\n\"\r\n\r\nENCLOSED BY \'\"\' ESCAPED BY \'\"\'\r\n\r\nload data LOCAL infile \'for_crm_history.csv\' into table cvsimp fields terminated by \',\' ENCLOSED BY \'\"\' ESCAPED BY \'\"\' LINES TERMINATED BY \"\\r\\n\";\r\n\r\n无权限时加：LOCAL\r\n\r\nload data LOCAL infile \'F:/import/22.txt\' into table crm_stat_contract_income_test fields terminated by \'\\t\' LINES TERMINATED BY \"\\r\\n\"\r\n\r\nload data infile \'F:/import/22.txt\' into table crm_stat_contract_income_test fields terminated by \'\\t\' LINES TERMINATED BY \"\\r\\n\"\r\n\r\n\r\nload data infile \'F:/import/22.txt\' into table crm_stat_achievement_income_import_2011Q3 fields terminated by \'\\t\' LINES TERMINATED BY \"\\r\\n\";\r\n\r\nload data infile \'F:/import/33.txt\' into table crm_stat_receive_money_import_2011Q3 fields terminated by \'\\t\' LINES TERMINATED BY \"\\r\\n\";\r\n\r\n导入列有小数时，可以要求数据表字段为varchar, 然后再从varchar转到DECIMAL即可( convert(amount_float_str, DECIMAL(14,2)) )\r\n\r\n查看字符集：\r\nshow variables like \'%char%\';\r\n修改变量：\r\nset character_set_client=utf8;\r\nset character_set_connection=utf8;\r\nset character_set_database=utf8;\r\nset character_set_results=utf8;\r\nset character_set_server=utf8;\r\nset character_set_client=utf8;\r\n\r\nset global\r\n\r\n\r\n授权\r\nGRANT ALL PRIVILEGES ON *.* TO youku@localhost IDENTIFIED BY \'sdSD*ss2D_ctsd\' WITH GRANT OPTION;\r\nflush privileges;\r\n\r\n\r\nGRANT ALL PRIVILEGES ON *.* TO \'youku\'@\'10.103.51.%\' IDENTIFIED BY \'sdSD*ss2D_ctsd\' WITH GRANT OPTION;\r\nDROP USER \'youku\'@\'10.103.51.135\'\r\n\r\nDROP USER \'root\'@\'10.10.221.92\';\r\n\r\nGRANT ALL PRIVILEGES ON *.* TO \'youku\'@\'%\' IDENTIFIED BY \'sdSD*ss2D_ctsd\' WITH GRANT OPTION;\r\nflush privileges;\r\n\r\nGRANT ALL PRIVILEGES ON *.* TO \'youku\'@\'10.155.56.60\' IDENTIFIED BY \'sdSD*ss2D_ctsd\' WITH GRANT OPTION;\r\n\r\n\r\nGRANT ALL PRIVILEGES ON *.* TO \'root\'@\'10.103.51.%\' WITH GRANT OPTION;\r\n\r\n\r\nGRANT ALL PRIVILEGES ON *.* TO \'root\'@\'%\' WITH GRANT OPTION;\r\nGRANT ALL PRIVILEGES ON *.* TO \'root\'@\'localhost\' IDENTIFIED BY \'\' WITH GRANT OPTION;\r\n\r\nselect table_rows,table_name from information_schema.tables t where t.table_schema=\'cpm\' order by table_rows des\r\n\r\nshow table status where comment=\'view\';\r\n1) mysql> show table status where comment=\'view\';\r\n（说明：Mysql5.1支持视图，视图被看作一种抽象表，因此显示视图状态的语句与显示表状态的语句相同，只是在comment列中以‘view’区分）\r\n\r\n2) mysql> select * from information_schema.tables where table_schema=\'yourDatabaseName\' and tabl