eo_effect_total where cast_id in (1008794,1008795,1008875,1008880,982553,982556) limit 10;\n\n'),(37,37,'多分单	=> 9.1~9.15\nADS		=> 9.15~10.1\n实时询价二期 => 9.15~10.1\nRSP		=> 10.1~10.31\n财务系统	=> 金刚10.8 ~ 12.31\n\n\nREV效果数据不对\n2016-08-30\n2016-08-29\n2016-08-27 √\n\n\n多分单业务线改造涉及\n1. 合同查询\n2. 非广告合同查询\n3. 正式合同查询\n4. 合同产品查询结果\n5. searchOrderForInvoice\n6. CRM合同总金额和产品金额不一致定时任务\n\n\nREV\n1. 业务线权限，包括：客户模块、合同模块\n2. 取第一直客业务线和地域，所有按业务线、地域查询的功能；所有页面显示业务线、地域、分单比的功能\n3. 排期统计：按天、按月、按产品，\n4. 新客户--》地区占比\n5. 首页“区域数据”列表\n6. 合同--》合同人员结构表，签单查询/导出，收入查询/导出\n7. 业务线统计\n\n\n'),(38,38,'package com.youku.fms.controller;\n\nimport java.util.Map;\n\nimport javax.servlet.http.HttpServletRequest;\n\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RequestParam;\nimport org.springframework.web.bind.annotation.ResponseBody;\n\nimport com.google.common.collect.Maps;\nimport com.youku.fms.filter.SessionUtil;\nimport com.youku.fms.services.auth.AuthService;\nimport com.youku.fms.util.jsonresult.JsonResult;\nimport com.youku.fms.util.jsonresult.JsonResultFactory;\n\n@Controller\npublic class AppCtrl {\n\n	@Autowired\n	private AuthService authService;\n	\n	@RequestMapping(value=\"/\")\n	public String app(HttpServletRequest request) {\n		String theme = SessionUtil.getTheme();\n		if(!SessionUtil.themes_classic.equals(theme)) {//目前支持两种theme\n			theme = SessionUtil.themes_default;\n		}\n		\n		request.setAttribute(\"theme\", theme);\n		return \"app.jsp\";\n	}\n	\n	@RequestMapping(value = \"setTheme\")\n	public @ResponseBody JsonResult setTheme(@RequestParam(value=\"theme\") String theme) {\n		if(!theme.equals(SessionUtil.themes_default) && !theme.equals(SessionUtil.themes_classic)) {\n			return JsonResultFactory.error(\"没有该主题\");\n		}\n		\n		SessionUtil.setTheme(theme);//FIXME 后期把这个默认值存到数据库或redis\n		return JsonResultFactory.success();\n	}\n\n	@RequestMapping(value = \"loadUserInfo\")\n	public @ResponseBody JsonResult loadUserInfo() {\n		Map<String, Object> retMap = Maps.newHashMap();\n		Map<String, Object> menuTree = authService.getUerModule();\n		retMap.put(\"menuTree\", menuTree);\n		\n		\n		return JsonResultFactory.success(retMap);\n	}\n}\n'),(39,39,'package com.youku.fms.controller;\n\nimport java.util.Map;\n\nimport javax.servlet.http.HttpServletRequest;\n\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RequestParam;\nimport org.springframework.web.bind.annotation.ResponseBody;\n\nimport com.google.common.collect.Maps;\nimport com.youku.fms.filter.SessionUtil;\nimport com.youku.fms.services.auth.AuthService;\nimport com.youku.fms.util.jsonresult.JsonResult;\nimport com.youku.fms.util.jsonresult.JsonResultFactory;\n\n@Controller\npublic class AppCtrl {\n\n	@Autowired\n	private AuthService authService;\n	\n	@RequestMapping(value=\"/\")\n	public String app(HttpServletRequest request) {\n		String theme = SessionUtil.getTheme();\n		if(!SessionUtil.themes_classic.equals(theme)) {//目前支持两种theme\n			theme = SessionUtil.themes_default;\n		}\n		\n		request.setAttribute(\"theme\", theme);\n		return \"app.jsp\";\n	}\n	\n	@RequestMapping(value = \"setTheme\")\n	public @ResponseBody JsonResult setTheme(@RequestParam(value=\"theme\") String theme) {\n		if(!theme.equals(SessionUtil.themes_default) && !theme.equals(SessionUtil.themes_classic)) {\n			return JsonResultFactory.error(\"没有该主题\");\n		}\n		\n		SessionUtil.setTheme(theme);//FIXME 后期把这个默认值存到数据库或redis\n		return JsonResultFactory.success();\n	}\n\n	@RequestMapping(value = \"loadUserInfo\")\n	public @ResponseBody JsonResult loadUserInfo() {\n		Map<String, Object> retMap = Maps.newHashMap();\n		Map<String, Object> menuTree = authService.getUerModule();\n		retMap.put(\"menuTree\", menuTree);\n		\n		\n		return JsonResultFactory.success(retMap);\n	}\n}\n'),(41,41,NULL);
